class Solution(object):    def maxCoins(self, nums):        nums1=[1]+[i for i in nums if i>0]+[1]        n=len(nums1)        dp=[[0]*n for j in range(n)]        for k in range(2,n,1):            for left in range(0,n-k):                right=left+k                for i in range(left+1,right):                    dp[left][right]=max(dp[left][right],nums1[left]*nums1[i]*nums1[right]+dp[left][i]+dp[i][right])        return dp[0][n-1]